import { NextApiRequest, NextApiResponse } from "next";
import { createApi } from "unsplash-js";

async function backgrounds(res: NextApiResponse, req: NextApiRequest) {
  const unsplash = createApi({
    accessKey: "DAQrUWKCxhZMjDH2S_X0sFv27A3OO0X3usud_ryy2CM",
  });

  const query = unsplash.search.getCollections({
    query: "hacker",
  });

  console.log(query);
  await res.status(200).json(query);
}

export default backgrounds;
